  home: HOME,
  join: JOIN,
  login: LOGIN,
  logout: LOGOUT,
  search: SEARCH,
  users: USERS,
  users_detail: USERS_DETAIL,
  edit_profile: EDIT_PROFILE,
  change_password: CHANGE_PASSWORD,
  videos: VIDEOS,
  upload: UPLOAD,
  videos_detail: VIDEOS_DETAIL,
  edit_video: EDIT_VIDEO,
  delete_video: DELETE_VIDEO
};

export default routes;

